  let d_aa = vec2<f32>(xf    , yf    );
  let d_ba = vec2<f32>(xf - 1.0, yf    );
  let d_ab = vec2<f32>(xf    , yf - 1.0);
  let d_bb = vec2<f32>(xf - 1.0, yf - 1.0);

